        <h1 className='yugitoken'>yugitonken</h1>
        <div class="abc">
            <h2>CREATE-AND-EARN FROM YOUR ITEMS</h2>

            <p>Yugi is the first pioneering NFT game offering an exclusive Create-To-Earn community for artists
